%[text] %[text:anchor:T_6C25F7E4] # Segmenting Color: using the RGB color model
%[text] In this exercise, we will use the RGB color model to segment an image of strawberries. 
%[text] Note: adapted from the Image Processing with MATLAB tutorial
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_37B586C1] ## Load Image
clearvars
close all

mmSetUnitDataFolder(2) % change folder to unit2 %[output:4069bcaa]
p.name = 'strawberries.png'; % create a structure p (p for pic or photo)
p.rgb = imread(p.name) % add image to structure %[output:8c1dfb3a]
imshow(p.rgb) %[output:70c10826]
%[text] - how can we segment out the strawberries? \
%%
%[text] %[text:anchor:H_A139EAD3] ## Review Channel Histograms 
%[text] Here we use **mmShowHist** to display the three channels and their histograms
mmShowHist(p.rgb)
%[text] - notice that there is nice contrast between strawberries and the background in the green and red channels
%[text] - In the blue channel, it's harder to see the strawberries
%[text] - Can we segment \
%%
%[text] ## Segment Channels Separately
%[text] Here we use the function **imsplit** to get the red and green channels. Notice we create structures ***r*** and ***g*** to store our channels 
[p.r,p.g] = imsplit(p.rgb);
p %[output:22bc5efa]
%%
%[text] %[text:anchor:H_4A5F9321] ### Segmenting the Red Channel 
%[text] Strawberries are red, so this should be a no-brainer, just segment the red channel right?
%[text] - Use **imbinarize** to create a mask of the red channel.
%[text] - Add the mask to p as "rMask" *.*
%[text] - display the mask \
p.rMask = []; 
%[text] - Hmm, not great
%[text] - Lot's of noise \
%%
%[text] %[text:anchor:H_2D5A445D] #### Inspect the red channel histogram
%[text] So, the default settings in `imbinarize` were unable to cleanly segment out the strawberries. Can you do better?
%[text] - Use **mmShowHist** to display just red channel and its histogram
%[text] - use **impixelinfo** to display the pixel information  \

%[text] - scrub over the strawberries to see the intensities in the red channel \
%%
%[text] %[text:anchor:H_915A14F2] #### Red Channel: Use Logical Operation to segment
%[text] - Create a mask of the red channel for every red pixel intensity greater than 150.
%[text] - Add to the p structure as "rMask150"
%[text] - Use **`imshowpair`** to overlay the `rMask` and `rMask150`
%[text] - Title as "imbinarize | mask150" \
p.rMask150 = []


%[text] - White mean overlap, green is the original mask
%[text] - So, less noise, but...
%[text] - Is it a good mask? \
%%
%[text] %[text:anchor:H_B8A5C8A4] #### Burn Mask onto Original Image
%[text] Here we use the function **imoverlay** to create a new image where the mask is shown in yellow. This is known as "burning" the mask into the image. 
clf
tiledlayout("horizontal","TileSpacing","none","Padding","tight")

nexttile;
burnedImg = imoverlay(p.rgb,p.rMask);
imshow(burnedImg); title('base mask')

nexttile;
burnedImg = imoverlay(p.rgb,p.rMask150);
imshow(burnedImg); title('mask 150')
%[text] Review the final result:
%[text] - So, what do you think? Any better?
%[text] - Are the strawberries fully segmented? \
%%
%[text] %[text:anchor:H_E6DE80D4] ### Segmenting the Green channel
%[text] Maybe the green channel works better.  
%[text] %[text:anchor:H_1B65D738] #### Inspect the Green Channel intensities
%[text] Here we use **`mmShowHist`** to display the green channel and its histogram
figure;
mmShowHist(p.g)
impixelinfo
%[text] - notice in the green channel, the strawberries are darker than the background \
%%
%[text] %[text:anchor:H_33D05AE1] #### Create the green mask
%[text] In the green channel, the strawberries are darker than the background. This makes using **imbinarize** difficult. So, instead we'll just create a mask using a relational operation.
%[text] - Create a mask of pixel intensity less than 50. Add the mask to *`p`* as gMask50. \
p.gMask50 = [];
%[text] 
%%
%[text] %[text:anchor:H_8EACA905] #### Green Segmentation: Inspect the result
%[text] Burn the `gMask50` mask into the RGB image, using **imoverlay**. Display your result and title as Green Mask

%[text] - What do you think? Any better? \
%%
%[text] ## Capture the Intensity profile of a Single Strawberry
%[text] Clearly, there is not enough information in just the green or the red channel alone to segment out the strawberries. Also, we seem to be getting a lot of false positives across each channel (noise). 
%[text] Perhaps if we combined information from both channels, we might get a better result. Also, instead of looking at the histogram across the whole image, perhaps we should focus on a region of the image where the image transitions from leaf to strawberry and then back to leaf. 
%[text] The function **improfile** captures an intensity profile along a line drawn on the image. The function works as follows
%[text] 1. The image will be displayed
%[text] 2. You will be able to draw a line on the image
%[text] 3. Draw a line similar to what's shown below by clicking once before the strawberry, and then once after the strawberry
%[text] 4. Double-click when you are done drawing. \
%[text] ![](text:image:4530)
%[text] The syntax is as follows:
figure; %[output:27b35a3f]
imshow(p.rgb) % display the image %[output:27b35a3f]
lp = improfile; % add a line to the image %[output:27b35a3f]
%%
%[text] #### Inspect `improfile` output
%[text] In the above syntax, after you double-click, `improfile` returns the variable `lp, which is a 3D vector. Meaning there are 3 lines, each with a certain number of rows (depending on the size of your line), 1 column, and three indices in the 3rd dimension (one for each channel).`
size(lp)
lp
%[text] - the values in *`lp`* are intensity values \
%%
%[text] %[text:anchor:H_A53BD940] ### Plot the line profile
%[text] Here we plot the intensity along the line profile for the red and green channels
figure
plot(lp(:,:,1),'r') % plot red channel profile
hold on
plot(lp(:,:,2),'g') % plot green profile
xlabel('Distance along profile')
ylabel('Channel intensity')
legend('red channel','green channel')
%[text] - The red and green lines indicates the respective intensity along the drawn line \
%[text] ![](text:image:9e91)
%[text] - The strawberry intensities appear to be greater than 150 in the red channel and less than 150 in the green channel \
%%
%[text] ### Segment using the red and green channel line profiles
%[text] OK, so, capturing the red or green channels separately didn't really work. 
%[text] What if we combine them? 
%[text] - Create a logical array that masks the intensities **greater than 150 in the red channel** AND the **intensities less than 100** **in the green channel**.
%[text] - Add the mask as "rgMask" to our structure ***s***.
%[text] - Burn that mask into the rgb image and display. \
p.rgMask = p.rMask150 & p.g < 100;
%%
clf
burnedImg = imoverlay(p.rgb,p.rgMask);
imshow(burnedImg); title('base mask')
%[text] - And... that doesn't really work either \
%%
%[text] %[text:anchor:H_C089EA7D] #### Capture the Difference Profile
%[text] What if we used the difference between the two channels?
%[text] Consider our profile plot, again. Here, we add a third line to indicate the difference between the red and green intensities at any given distance along the profile line 
figure;
plot(lp(:,:,1),'r')
hold on
plot(lp(:,:,2),'g')
xlabel('distance along profile')
Y = lp(:,:,1) - lp(:,:,2); % calculate difference between the green and red intensities
plot(Y,'k--')
ylabel('Channel intensity')
%[text] - Notice that the difference is high (Intensity\>100)  only along the part of the profile line that corresponds to the strawberry
%[text] - The dashed line drops precipitously after  the strawberry \
%[text] 
%%
%[text] ### Create a difference image
%[text] If we subtract the Green Intensities from the Red intensities, the resultant values should be high inside the strawberries and low outside of the strawberries:
figure; %[output:605f7b18]
p.diffRG = p.r-p.g; % difference image
imshow(p.diffRG) %[output:605f7b18]
%[text] - And that's what we get - bright strawberries and a dark background \
%%
%[text] %[text:anchor:H_680A1B05] #### Mask the difference image
%[text] **imbinarize** can easily mask the difference image. 
%[text] - Use **imbinarize** to create a mask of the difference image
%[text] - Call your new mask ***diffMask*** and add to *`p`*.
%[text] - Burn the new mask onto the original image and display \

%%
%[text] - Hey, that's pretty good. Go math.  \

%%
%[text] %[text:anchor:H_41A0632A] ### Clean Mask using Morphological Operations
%[text] There's a bit of noise, though. 
%[text] We need to clean that up
%[text] - Remove the mask that's touching the edge of the image (**`imclearborder`**)
%[text] - Remove the small piece of strawberry that is showing up behind the larger strawberries in the foreground ( **`bwareaopen`**). You will need to input a large number to remove that piece of strawberry
%[text] - Display the final mask \


%[text] - Notice, that some of the strawberries are touching \
%%
%[text] %[text:anchor:H_9E120DDF] ### Separate Touching Blobs 
%[text] The watershed transform is used to detach connected components (CC) that are just barely touching. It's name comes from the geological concept of a watershed - a region of relatively high elevation separating two lower lying regions (or basin) 
%[text] ![](text:image:1318)![](text:image:0b66)
%%
%[text] %[text:anchor:H_BA36DD21] #### mmGetWatershed
%[text] The course function **`mmGetWatershed`** automates the process of separating touching blobs. 
%[text] Here we use the following inputs:
%[text] 1. The mask
%[text] 2. The size of the regional minima (part of the watershed process)
%[text] 3. ShowSteps = true - visualizes the steps and the final outcome \
%[text] 
p.watershed = mmGetWatershed(p.diffMask,5,"ShowSteps",true); %[output:1c505367]
%[text] - and that works pretty good. 
%[text] - What happens if you change Input 2 to a 1? \
%%
%[text] ### Review the final product
figure;
mmShowBurnImage(p.rgb,p.watershed);
%%
%[text] %[text:anchor:H_804A3D7E] ## Region properties
%[text] calculate some region properties of the strawberries:
%[text] - calculate {'Area','MeanIntensity','Circularity'}, where mean intensity is calculated from the difference image
%[text] -  assign to the table ***rp*** \
rp = regionprops('table',p.watershed,p.diffRG,{'Area','MeanIntensity','Circularity'});
%%
%[text] Plot boxcharts of your data. One figure, three boxcharts.
figure
boxchart(rp.Area)
%%
%[text] ## Segment Anything Model (SAM)
%[text] Ok, well that was fun. But what if you don't want to do all that work to solve your segmentation problems. Well, that's where [SAM](https://github.com/facebookresearch/segment-anything) comes into play. Brought to you by the same people who brought you FaceBook and the Meta Glasses, SAM is a Machine Learning Model trained on 11 million images and 1.1 billion masked. It was designed to recognized objects in an image. Let's give it a whirl.
%[text] You can find SAM in the Image Segmenter App
imageSegmenter(p.rgb)
%[text] 1. **Segment the Image**: Once the app is open, you can use different methods to segment the strawberries. For example, you can use thresholding or the Segment Anything Model (SAM). \
%[text] - **Using Thresholding**:
%[text] -     Click on the "Threshold" button in the Create Mask section.
%[text] -     Choose between Global, Manual, or Adaptive thresholding to isolate the strawberries based on their color or intensity.
%[text] - **Using Segment Anything Model (SAM)**:
%[text] -     Select the SAM option to automatically segment the strawberries by clicking on the corresponding button in the app. \
%[text] 1. **Refine and Save the Mask**: After segmenting, you can refine the         mask using morphological operations if needed. Once satisfied, save the binary mask.
%[text] 2. **Export the Code**: You can also export the code used for segmentation by clicking on the appropriate option in the app. \
%[text] This process allows you to effectively segment strawberries from the image using MATLAB's powerful image processing capabilities.
%[text] 

